import { useState } from "react";

export default function Home() {
  const [bla, setBla] = useState(false);
  const stringBla = bla.toString()
  console.log(stringBla)

  return (
    <div>
      <h2>{stringBla}</h2>
      <hr></hr>
      <button onClick={() =>setBla(!bla)}>
        Change
      </button>
    </div>
  )
}
